import React from 'react';

const ScienceAndTechnologyBusiness: React.FC = () => {
    return (
        <div>
            <section className="p-6 bg-white rounded-lg shadow-md mb-8">
                <div className="text-center mb-4">
                    <img 
                        className="mx-auto mb-4 rounded-lg" 
                        src="../wp-content/uploads/2023/04/103732q2-scaled.jpg" 
                        alt="Technology in the hands" 
                        width={2560} 
                        height={1776} 
                    />
                    <h3 className="text-2xl font-bold text-gray-800">DOANH NGHIỆP KHOA HỌC VÀ CÔNG NGHỆ LÀ GÌ?</h3>
                </div>
            </section>

            <section className="p-6 bg-white rounded-lg shadow-md">
                <div className="text-center mb-4">
                    <h2 className="text-2xl font-bold text-gray-800">THÔNG TIN VỀ DOANH NGHIỆP KHOA HỌC VÀ CÔNG NGHỆ</h2>
                </div>
                <div className="mt-4">
                    <p className="text-gray-700 text-lg">
                        Doanh nghiệp khoa học và công nghệ là doanh nghiệp thực hiện sản xuất, kinh doanh, dịch vụ khoa học và công nghệ để tạo ra sản phẩm, hàng hoá từ kết quả nghiên cứu khoa học và phát triển công nghệ.
                    </p>
                </div>
            </section>
        </div>
    );
};

export default ScienceAndTechnologyBusiness;
